      height: 100%;
      background-color: rgba(0, 0, 0, 0.7);
      z-index: -1;
    }
  }
  &__box {
    display: flex;
    align-items: center;
    width: 100%;
    padding: 1.5rem;
    flex-direction: column;
    justify-content: center;
    min-width: 10rem;
    position: absolute;
    top: 40%;
    left: 50%;
    width: 100%;
    transform: translate(-50%, -50%);
    align-items: center;
    color: c.$primary-color;
    z-index: 1;

    &--title {
      margin-bottom: 0.25rem;
      padding: 0.25rem;
      text-align: center;
      font-size: 1.5rem;
      font-weight: 100;
    }
    &--subtitle {
      width: 100%;
      text-align: center;
      font-size: 2.25rem;
      font-family: var(--bold-font);
    }
  }
}

